import "./BoxPhotoProfil.css"

const BoxPhotoProfil = (props) =>{
   return(
      <div className="BoxPhoto">
         <div></div>
         <p>{props.prezivkaUser}</p>
      </div>
   )
}
export default BoxPhotoProfil
